import './styles.css';

function Header() {
  return (
    <header>
      <div className="header-content">
        <h1>ExchangeRate</h1>
      </div>
    </header>
  );
}
function MyButton(){
  return <button><img src='https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRERK0B77joiviFm4EuPSo_15qq5MJeIXK2pA&s'></img></button>;
}
function UserInput() {
  return (
    <label>
     <input name="myInput" />
    </label>
  );
}

function Converter() {
  return (
    <div className="Converter">
      <div className="Converter-title">Converter</div>
      <div className="Converter-body">
      <UserInput /><MyButton/><UserInput />
      </div>
    </div>
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Converter />
      </main>
    </div>
  );
}

export default App;
